import React, { useState, useEffect } from 'react';
import weaponsAPI from '../services/dsApi';

const HomePage = () => {
  const [weapon, setWeapon] = useState([]);
  useEffect(() => {
    weaponsAPI().then((resp) => {
      setWeapon(Object.keys(resp.ds3_weapons));
    });
  }, []);
  return (
    <section>
      {weapon.map((Post) => (
        <div>{Post}</div>
      ))}
    </section>
  );
};

export default HomePage;
